import React, { Component } from 'react';
import c1 from '../Assets/c1.jpg'

function Navbar() {
  return (
    <div className='navbar'>
      <div className='nav-logo'>
        <img> src={c1}</img>
        <p>SHOPPER</p>

      </div>
      <div>
        <ul>
         <li></li>

        </ul>
      </div>
    </div>
  )
}

export default Navbar;
